import{_ as e,c as n,o as t,a4 as r}from"./chunks/framework.uQk9_EO2.js";const o="data:image/png;base64,",a="/docs/cocos/assets/sort.D40uYAeH.png",C=JSON.parse('{"title":"Rendering Order","description":"","frontmatter":{},"headers":[],"relativePath":"en/ui-system/components/engine/priority.md","filePath":"en/ui-system/components/engine/priority.md","lastUpdated":1712305443000}'),s={name:"en/ui-system/components/engine/priority.md"},i=r('<h1 id="rendering-order" tabindex="-1">Rendering Order <a class="header-anchor" href="#rendering-order" aria-label="Permalink to &quot;Rendering Order&quot;">​</a></h1><h2 id="_2d-rendering-node-ordering" tabindex="-1">2D rendering node ordering <a class="header-anchor" href="#_2d-rendering-node-ordering" aria-label="Permalink to &quot;2D rendering node ordering&quot;">​</a></h2><p>2D rendering nodes can be divided into nodes under Canvas and nodes that are not under Canvas:</p><ul><li><p>The nodes under Canvas can be found in <strong>UI node ordering</strong> below.</p></li><li><p>The nodes that are not under Canvas, the user can choose to enable depth detection and occlusion display of 3D objects through <a href="./ui-material">custom materials</a>, which will render the occlusion according to the Z-axis coordinates of the object when enabled (see example <a href="https://github.com/cocos/cocos-test-projects/tree/v3.8/assets/cases/2D" target="_blank" rel="noreferrer">2d-rendering-in-3d</a>).</p></li></ul><h2 id="ui-node-ordering" tabindex="-1">UI node ordering <a class="header-anchor" href="#ui-node-ordering" aria-label="Permalink to &quot;UI node ordering&quot;">​</a></h2><p>UI nodes refer to the UI nodes under the Canvas node, the mixing of nodes is strictly sorted according to the node tree. The rendering order of the UI uses a <strong>Breadth-First Sorting</strong> scheme, and the node tree order is the final rendering data submission order. So the user can change the order of the nodes under their parents by setting the <code>siblingIndex</code> of the nodes and thus change the rendering order.</p><p>For example:</p><p><img src="'+o+'" alt="priority.png"></p><p>Therefore, the overall rendering order in the figure above is <strong>A -&gt; a1 -&gt; a2 -&gt; B -&gt; b1 -&gt; C</strong>, and the rendering state on the screen is <strong>C -&gt; b1 -&gt; B -&gt; a2 -&gt; a1 -&gt; A</strong>. i.e. <strong>from top to bottom</strong>.</p><p><code>setSiblingIndex</code> is used to change the position of the current node in the children array of the parent node. If set at runtime by script, the changed node tree data will not be serialized. If the parameter passed in is larger than the length of the children array, it will be set to the end of the array, and if it is within the range, it will be inserted into the corresponding position. This operation is related to the state of the node tree in real time, and the user needs to know the current state of the node tree and perform the operation to get the expected result.</p><h2 id="detailed-explanation" tabindex="-1">Detailed Explanation <a class="header-anchor" href="#detailed-explanation" aria-label="Permalink to &quot;Detailed Explanation&quot;">​</a></h2><p><strong>Sorting</strong> is a very simple function, but the final rendering is based on the rendering capabilities provided by different platforms. <br> Therefore, explain here. If you encounter an error in <strong>UI rendering</strong>, such as flickering or unwanted artifacts or other please consider the following. The first thing to check is the <strong>ClearFlag</strong> of all cameras (<strong>Camera</strong> and <strong>Canvas</strong>) in the scene, and make sure that the lowest <strong>Canvas</strong> or <strong>Camera</strong>&#39;s <strong>ClearFlag</strong> property is set to <strong>SOLID_COLOR</strong> in each scene.</p><p>To set the <strong>ClearFlag</strong> property, please refer to the following situations:</p><ul><li>If there is only one <strong>UI Canvas</strong> or <strong>3D Camera</strong> in the scene, then the <strong>ClearFlag</strong> property is set to <code>Solid_Color</code>.</li><li>If the scene contains 2D background layer, 3D scene layer, 2D UI layer, then: <ul><li>For cameras used for 3D scene rendering, make sure the first rendered camera is <strong>SOLID_COLOR</strong> (or set to <strong>SKYBOX</strong> if there is a skybox configured), and the rest of the cameras are determined by the project requirements.</li><li>Cameras used for UI rendering (under Canvas) should be <strong>DEPTH ONLY</strong>.</li><li>If a camera has a targetTexture set, set it to <strong>SOLID_COLOR</strong>. <img src="'+a+'" alt="sort"></li></ul></li></ul>',14),d=[i];function A(g,h,c,l,p,f){return t(),n("div",null,d)}const b=e(s,[["render",A]]);export{C as __pageData,b as default};
